import React, { Component } from 'react';
import { bindActionCreators } from 'redux'; 
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';


class Header extends Component {

	render(){

		let user
		if(this.props.user){
			user = this.props.user
			console.log(user)
		}


		return(
			<div style={{height:'49px', paddingLeft:'30px', paddingRight:'30px', display:'flex', alignItems:'center'}}>
				<div style={{width:'20%', display:'inline-block'}}>
					{!user &&
					<span className='topbar'>Hi! <span className='pink'>Sign in</span> or <span className='pink'>Register</span></span>
					}
					{user &&
					<span className='topbar'>Hi! <span className='pink'>User</span></span>
					}

				</div>

				<div style={{display:'flex', width:'40%', justifyContent:'space-around', textAlign:'center'}}>
					<span className='topbar' style={{flex:'1'}}>Daily Deals</span>
					<span className='topbar' style={{flex:'1'}}>Sell</span>
					<span className='topbar' style={{flex:'1'}}>Help & Contact</span>
				</div>

				<div style={{width:'25%', display:'inline-block', textAlign:'center'}}>
					<span className='topbar'>$ GBP</span>
				</div>

				<div style={{width:'15%', display:'inline-block', textAlign:'center'}}>
					<span className='topbar'>Your Bag: $3.99</span>
				</div>
			</div>
		);
	}
}



function mapStateToProps(state){
	return { 
		user:state.user.user
	};
}

const mapDispatchToProps = (dispatch) => {
	return bindActionCreators({

	}, dispatch);
};

Header = connect(mapStateToProps, mapDispatchToProps)(Header);
export default withRouter(Header);
